import React from 'react'
import './work.css'
import Works from './Works';

function Work() {
    return (
        <section className = "work section" id="project">
            <h2 className="section__title">Projects</h2>
            <span className="section__subtitle">Most recent works</span>
            <Works />
        </section>
    )
}

export default Work;
